import React, { Component } from 'react';
import Navbar from './components/Navbar'
import Home from './components/Home'
import Table from './components/Table'
import Form from './components/Form'
import { BrowserRouter, Route} from 'react-router-dom'

class App extends Component {
  state = {
    tickets : [
      { id: 1, datecomplete: new Date(), month: 'November', week: '5', theme: 'Julia', ticketnumber: '370156', website: 'google.com', remarks: 'Edit Page', status: 'Complete', skill: 'Migration' }
    ]
  }

  render() {
    return (
      <BrowserRouter>
        <div className="chat-app">
          <Navbar />
          <Route exact path='/' component={Home} tickets={this.state.tickets}/>
          <Route path='/table' component={Table} />
          <Route path='/form' component={Form} />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
